import React from "react";
import Goal from "./Goal";

function GoalsList(props) {
  console.log(props);
  return (
    <div className="goals__list">
      <ul className="list">
        {props.goals.length ? console.log("not empty") : <h1>EMPTY</h1>}
        <Goal />
        <Goal />
        <Goal />
      </ul>
    </div>
  );
}

export default GoalsList;
